webpackJsonp([0x7ad07a5bcf91],{5804:function(e,t){e.exports={data:{post:{html:"<p>OK, 60% of the vote has been counted, and Mondale hasn't quite lost the Minnesota Senate race yet, so I still have time to tell my Mondale story. In our Minneapolis days, in 1985 or so, I was working weekend nights at the radio room at <a href=\"http://www.startribune.com\">StarTribune: Newspaper of the Known Universe</a>. My job was to listen to police radio and wake up a photographer if anything interesting happened. (Note that I was not to wake up a reporter. Words can be written after the fact.) Anyway, one boring night I was looking through the desk drawer, and discovered hundreds of xeroxed address labels, all with the same address. Walter Mondale's law firm in Washington. I have no idea what the news room was regularly sending to Walter Mondale... it certainly wasn't his newspaper subscription. I imagine there was some deep dark link between the paper and the politician. I have a vivid imagination.</p>",fields:{title:"Deep Dark Links",date:"06 Nov 2002",url:"https://papascott.de/2002-11-06-deep-dark-links/"}}},pathContext:{slug:"/2002-11-06-deep-dark-links/",prev:{fields:{title:"Website Boy",date:"05 Nov 2002",slug:"/2002-11-05-website-boy/"}},next:{fields:{title:"",date:"06 Nov 2002",slug:"/2002-11-06-schroeder-congratulates-bush/"}}}}}});
